function Login() {
    return (
        <div className="login">
            <form>
                <div className="input-container">
                    <label>SDSU Email</label>
                    <input type="email" name="email" required/>
                </div>
                <div className="input-container">
                    <label>Password</label>
                    <input type="password" name="pass" required/>
                </div>
            </form>
        </div>
    );
}

export default Login;
